// All the places you can go!
const AllRoutes = () => {
  return (
    <>
      <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/editor" element={<Editor/>}/>
      <Route path="/recently-deleted" element={<RecentlyDeleted/>}/>
      </Routes>
    </>
  );
}; 

export default AllRoutes;
